    class DummyPublishDocument : IPublishDocument
    {
        string _description = string.Empty;
        public DummyPublishDocument(string description)
        {
            _description = description;
        }

        public string Description
        {
            get
            {
                return _description;  
            }
            set
            {
                throw new NotImplementedException();
            }
        }

        public string StorageVolume
        {
            get
            {
                List<StorageVolumeItem> storageVolumeList = new StorageVolumeList().createStorageVolumeList();
                return storageVolumeList.Single(volume => volume.Code == "STD").Uuid;
            }
            set
            {
                throw new NotImplementedException();
            }
        }

        public string Owner
        {
            get
            {
                List<OwnerItem> ownerList = new OwnerList().createOwnerList();
                return ownerList.Single(owner => owner.Login.StartsWith("admin")).Uuid;
            }
            set
            {
                throw new NotImplementedException();
            }
        }

